workflow_source:
version 1.0

task GoodTask {
  input {
    String name
  }
  command <<<
    echo ${name}
  >>>
  output {
    String result = stdout()
  }
}

workflow TestWorkflow {
  input {
    String name
    INVALID TYPE here
  }

  call GoodTask {
    input: name = name
  }

  output {
    String result = GoodTask.result
  }
}
